USE master 
GO 


IF  EXISTS (SELECT * FROM sys.databases WHERE name = N'data_analysis_orders') DROP DATABASE data_analysis_orders
GO 


CREATE DATABASE data_analysis_orders
GO 


USE data_analysis_orders
GO 


create table orders (
	order_id INT NOT NULL,
	item_id INT NOT NULL,
	order_quantity INT,
	customer_id INT,
	order_date DATE
);


create table items (
	item_id INT PRIMARY KEY,
	item_name VARCHAR(50),
	item_price DECIMAL(4,2)
);


create table customers (
	id INT PRIMARY KEY,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50)
);


DELETE t_orders  
FROM   
(  
   SELECT *,  
   ROW_NUMBER() OVER (PARTITION BY order_id, item_id ORDER BY order_id, item_id) rn  
   FROM orders   
) t_orders  
WHERE t_orders.rn > 1;  


ALTER TABLE orders ADD CONSTRAINT orders_pk PRIMARY KEY (order_id, item_id);


ALTER TABLE orders ADD CONSTRAINT items_fk FOREIGN KEY (item_id) REFERENCES items(item_id);


ALTER TABLE orders ADD CONSTRAINT customer_fk FOREIGN KEY (customer_id) REFERENCES customers(id);




